import Header from './components/Header'
import './App.css';
import Sidebar from "./components/Sidebar";
import Home from "./page/Home";
import DashboardContextProvider from '../src/dashboardContext'



function App() {
  return (
      <DashboardContextProvider>
        <div className="App">
            <Header/>
            <main className="main">
                <Sidebar />
                <Home/>
            </main>


        </div>
      </DashboardContextProvider>

  );
}

export default App;
